import React from "react";
const renderAllBeer = (allBeer) => {
    return allBeer.map((beer) => {
        const {id, title} = beer;
        return(
            <li className='list-group-item'
                key={id}
            >
                <span className='term'>{title}</span>
            </li>
        );
    })
}

export {renderAllBeer};
